[application]

name="Bubbles"
main_scene="res://levels/level_1.scn"
icon="icon.png"
boot_logo=img(rgb, 0, 64, 64, )
boot_bg_color=#ff656d8d

[autoload]

global_loader="res://global_loader.gd"

[display]

width=800
height=600
stretch_mode="disabled"
stretch_aspect="keep"

[input]

shoot=[mbutton(0, 1)]
Esc=[key(Escape)]
Ctrl=[key(Control, C)]
Zoom_Up=[mbutton(0, 5), mbutton(1, 5), mbutton(0, 2)]
Zoom_Down=[mbutton(0, 4), mbutton(1, 5), mbutton(0, 3)]
Space=[key(Space)]

[physics]

fixed_fps=60

[physics_2d]

default_gravity=0

[render]

thread_model=1
default_clear_color=#ff6d778d
